  false,\n\t\"url\": null,\n\t\"notes\": \"Northern Florida Eustrongylid larvae were
  found in 66 fish from 5 of 9 the sites (Table 2). Four species Gambusia holbrooki,
  Heterandria formosa, Lepomis gulosus, and Lucania goodei of the 13 examined were
  infected. Infected fish were found most commonly at sites receiving sewage runoff,
  followed by those receiving urban runoff. No infected fish were found at sites receiving
  livestock runoff in northern Florida. Sugarcane runoff was not examined in northern
  Florida. Sites with infected fish had lower total nitrogen, total Kjeldahl nitrogen,
  total phosphorus, total organic carbon, and biological oxygen demand than sites
  with no infected fish (Table 4). No differences were found in soil parameters when
  these two groups were compared (Table 5). Southern Florida Five fish of the 7,488
  examined contained eustrongylid larvae (Table 3). Only one infected Gambusia holbrooki
  was found at each of four sites, and a single Lucania goodei was infected at another.
  Sixteen species of fish were examined.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
